package main

func MatchParens(lst []string) string {
	// Total counts
	s1 := lst[0]
	s2 := lst[1]

	open1 := countChar(s1, '(')
	close1 := countChar(s1, ')')
	open2 := countChar(s2, '(')
	close2 := countChar(s2, ')')

	totalOpen := open1 + open2
	totalClose := close1 + close2

	// If total opens and closes don't match, impossible
	if totalOpen != totalClose {
		return "No"
	}

	// Try both orderings
	if isBalanced(s1 + s2) {
		return "Yes"
	}
	if isBalanced(s2 + s1) {
		return "Yes"
	}

	return "No"
}

func countChar(s string, ch byte) int {
	count := 0
	for i := 0; i < len(s); i++ {
		if s[i] == ch {
			count++
		}
	}
	return count
}

func isBalanced(s string) bool {
	balance := 0
	for i := 0; i < len(s); i++ {
		if s[i] == '(' {
			balance++
		} else if s[i] == ')' {
			balance--
		}
		// At any point, we shouldn't have more closing than opening
		if balance < 0 {
			return false
		}
	}
	// At the end, all should be balanced
	return balance == 0
}
